### Main Idea
For chunks `[c1, c2, c3, ..., cn]`, we have to maintain the property: `max(ci) <= min(cj)` if `i < j`. So we can create a monotonously increasing stack `stack` to keep track of the max value for each previous chunk. 

If `arr[i] >= stack.peek()`, we can greedily create a new chunk and `stack.push(arr[i])`. Else, we need to find the previous chunk with max value smaller or equal to `arr[i]`, say `ck`, and we need to merge all the chunks `[c_k+1, ... c_cur]` with `arr[i]`.

To merge chunks, we can just pop all the max values representing those chunks off the stack, and push back the max among them (in our case, it will be stack top cuz this stack is increasing) as the max of the new chunk. 

Finally the size of the stack will be the number of chunks.
### Code
```java
class Solution {
    public int maxChunksToSorted(int[] arr) {
        int n = arr.length;
        Deque<Integer> stack = new ArrayDeque<>();
        for (int num : arr) {
            int max = num;
            while (!stack.isEmpty() && stack.peek() > num) {
                max = Math.max(max, stack.pop());
            }
            stack.push(max);
        }
        return stack.size();
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(n)`

### Main Idea
Use iteration, process two nodes at a time. Say `tail` is the current tail of the new linked list, we use ListNode `cur` to keep tracks of the current node being processed, `next` is the second node being processed, here are three situations:

1. `cur` is `null`, that means we are done and we can exit the loop.
2. `cur` is not `null`, but `next` is `null`, which means only one node is left, and no need to swap, just append it to the current tail.
3. Neither of them is `null`, so we record the next node to process in `nextCur`, then append `next` to the tail, and  append `cur` to `next`, also need to make `cur.next = null` and set it as the new tail.

To simplify coding and handle edge case, a dummy head is used.

### Code
```java
class Solution {
    public ListNode swapPairs(ListNode head) {
        ListNode dummyHead = new ListNode(), tail = dummyHead, cur = head;
        while (cur != null) {
            ListNode next = cur.next;
            if (next == null) {
                tail.next = cur;
                break;
            } else {
                ListNode nextCur = next.next;
                tail.next = next;
                next.next = cur;
                cur.next = null;
                tail = cur;
                cur = nextCur;
            }
        }
        return dummyHead.next;
    }
}
```

### Complexity Analysis
* Time: `O(n)`
* Space: `O(1)`

### Main Idea
If we pick a node as root of the tree, then we will need to determine the left and right subtrees with the list nodes on the left and right hand sides, which is the same problem but with a smaller size.

Also, we want the BST to be balanced, so when constructing the tree, we want to **choose the middle list node as the root**, so left and right will have same number of nodes, or one side will have an extra node.

**Algorithm**
1. Base case: If there is only one node left, return it as a new `TreeNode`.
2. Get the middle node.
3. Recusrivly call the function on the left and right lists and get the left and right subtree.

### Code
```java
class Solution {
    public TreeNode sortedListToBST(ListNode head) {
        if (head == null) return null;
        if (head.next == null) return new TreeNode(head.val);

        ListNode fast = head, slow = head;
        while (fast != null && fast.next != null) {
            fast = fast.next.next;
            slow = slow.next;
        }

        ListNode prev = head;
        while (prev.next != slow) {
            prev = prev.next;
        }
        prev.next = null;
        TreeNode left = sortedListToBST(head);
        TreeNode right = sortedListToBST(slow.next);
        TreeNode root = new TreeNode(slow.val);
        root.left = left;
        root.right = right;
        return root;
    }
}
```
### Complexity Analysis
Time: `O(nlogn)`, divide and conquer.
Space: `O(height) = O(logn)`  for recursive calls.

```java
public class Solution {
    public ListNode getIntersectionNode(ListNode headA, ListNode headB) {
        int lenA = listLen(headA), lenB = listLen(headB), diff = Math.abs(lenA - lenB);
        ListNode cur1 = lenA < lenB ? headB : headA;
        ListNode cur2 = lenA < lenB ? headA : headB;
        for (int i = 0; i < diff; ++i) {
            cur1 = cur1.next;
        }
        while (cur1 != null && cur2 != null) {
            if (cur1 == cur2) {
                return cur1;
            } else {
                cur1 = cur1.next;
                cur2 = cur2.next;
            }
        }
        return null;
    }

    private int listLen(ListNode head) {
        if (head == null) {
            return 0;
        }
        return 1 + listLen(head.next);
    }
}
```

### Main Idea
Define two pointers `fast` and `slow`, each iteration, `fast` moves 2 steps forward while `slow` moves 1 step. If there is a cycle, then `fast` will equals `slow` eventually, and if not, we will exit the loop.

If a cycle is detected, we need to find the starting point. 

```
fast = 2 * slow

fast = l + n1 * c + t
slow = l + n2 * c + t


l + n1 * c + t = 2 * l + 2 * n2 * c + 2 * t
l = n1 * c - 2 * n2 * c = c * (n1 - 2 * n2) = n' * c - t
```

```
     L
--------   ----I-----
           |         | D
           ----------
```
### Code
```java
public class Solution {
    public ListNode detectCycle(ListNode head) {
        if (head == null) return null;
        ListNode fast = head, slow = head;
        while (fast != null && fast.next != null) {
            fast = fast.next.next;
            slow = slow.next;
            if (fast == slow) {
                while (slow != head) {
                    slow = slow.next;
                    head = head.next;
                }
                return head;
            }
        }
        return null;
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(1)`

### Main Idea
We can use a linked list to simulate the cache queue, but if we just use a linked list, then the time complexity of `get()` and `remove()` will be `O(n)`.

To make the `get()` and `remove()` operations more efficient, we can use a map to store `(key, ListNode)` pairs. Given a key, we can get its node immediately from the map instead of going through the linked list.
### Code
```java
class LRUCache {
    private class DBListNode {
        private DBListNode prev;
        private DBListNode next;
        private int key;
        private int val;

        private DBListNode(int key, int val) {
            this.key = key;
            this.val = val;
        }
    }

    private DBListNode head;
    private DBListNode tail;
    private int cap;
    private int size;
    private Map<Integer, DBListNode> map;

    public LRUCache(int capacity) {
        head = new DBListNode(-1, -1);
        tail = new DBListNode(-1, -1);
        map = new HashMap<>();
        head.next = tail;
        tail.prev = head;
        cap = capacity;
    }

    public int get(int key) {
        if (!map.containsKey(key)) {
            return -1;
        }
        DBListNode node = map.get(key);
        node.prev.next = node.next;
        node.next.prev = node.prev;

        node.prev = head;
        node.next = head.next;
        head.next.prev = node;
        head.next = node;
        return node.val;
    }

    public void put(int key, int value) {
        DBListNode node;
        if (map.containsKey(key)) {
            node = map.get(key);
            node.val = value;
            node.prev.next = node.next;
            node.next.prev = node.prev;
        } else {
            if (size < cap) {
                ++size;
            } else {
                DBListNode remove = tail.prev;
                remove.prev.next = tail;
                tail.prev = remove.prev;
                map.remove(remove.key);
            }
            node = new DBListNode(key, value);
        }

        node.prev = head;
        node.next = head.next;
        head.next.prev = node;
        head.next = node;
        map.put(key, node);
    }
}
```

### Complexity Analysis
Time: `O(1)` for all operations
Space: `O(cap)`

### Main Idea
Use dfs to find all the root-to-leaf path numbers(use an integer `s` to record the number represented by previous nodes in the path, and `newNum = s * 10 + root.val`), and sum them up.

### Code
```java
class Solution {
    private int sum;
    public int sumNumbers(TreeNode root) {
        if (root == null) return 0;
        sum = 0;
        dfs(root, 0);
        return sum;
    }

    private void dfs(TreeNode root, int s) {
        if (root.left == null && root.right == null) {
            sum += (s * 10 + root.val);
            return;
        }

        // dfs
        if (root.left != null) dfs(root.left, s * 10 + root.val);
        if (root.right != null) dfs(root.right, s * 10 + root.val);
    }
}
```

### Complexity Analysis
Time: `O(n)`
Space: `O(h) = O(n)`

### Main Idea
This problem is asking for the leftmost node of the last layer, and when it comes to traversal by layer, BFS comes in handy.

In a standard BFS algorithm, we use a queue to keep track of the nodes on each layer, we just need to modify the algorithm to record the first node of the current layer, and if we exit the loop from the current layer, that means this is the last layer, and the node we recorded will be the one we want to find.

### Code
```java
class Solution {
    public int findBottomLeftValue(TreeNode root) {
        Queue<TreeNode> q = new ArrayDeque<>();
        q.offer(root);
        int res = 0;
        while (!q.isEmpty()) {
            res = q.peek().val;
            int size = q.size();
            for (int i = 0; i < size; ++i) {
                TreeNode n = q.poll();
                if (n.left != null) q.offer(n.left);
                if (n.right != null) q.offer(n.right);
            }
        }
        return res;
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(n)`

### Main Idea
Count the frequency and use a PriorityQueue to pop out the least frequent elements.
### Code
* java

```java
class Solution {
    public int[] topKFrequent(int[] nums, int k) {
        int n = nums.length;
        Map<Integer, Integer> freq = new HashMap<>();
        for (int num : nums) {
            freq.put(num, freq.getOrDefault(num, 0) + 1);
        }

        // {num, freq}
        PriorityQueue<int[]> minHeap = new PriorityQueue<>((p1, p2) -> p1[1] - p2[1]);
        freq.forEach((key, val) -> {
            minHeap.offer(new int[] {key, val});
            if (minHeap.size() > k) {
                minHeap.poll();
            }
        });

        return minHeap.stream().map(p -> p[0]).mapToInt(Integer::intValue).toArray();
    }
}
```
### Complexity Analysis
Time: `O(nlogk)`
Space: `O(n)`

### Main Idea
Brute force is to use 3 nested loops, but obviously it will cause TLE.

For each element in the input array, we can set it as the first point in tuple, and we calculate the distance from it to all other points, and use a map to record the count. So `map[k] = cnt`  means there are `cnt` points with distance `k` from the first point.

Once we have all the counts, iterate through the distances, if there are `cnt` points with distance `k` to the first point, it can form `cnt * (cnt - 1)` pairs.

### Code
```java
class Solution {
    public int numberOfBoomerangs(int[][] points) {
        if (points == null || points.length < 3) {
            return 0;
        }

        int n = points.length, res = 0;
        for (int i = 0; i < n; ++i) {
            Map<Integer, Integer> squareDistCount = new HashMap<>();
            for (int j = 0; j < n; ++j) {
                if (i == j) {
                    continue;
                }

                int squareDist = calculateDistanceSquare(points[i], points[j]);
                int count = squareDistCount.getOrDefault(squareDist, 0) + 1;
                squareDistCount.put(squareDist, count);
            }

            for (int count : squareDistCount.values()) {
                if (count >= 2) {
                    res += count * (count - 1);
                }
            }
        }
        return res;
    }


    private int calculateDistanceSquare(int[] pointA, int[] pointB) {
        int y = pointA[1] - pointB[1];
        int x = pointA[0] - pointB[0];
        return y * y + x * x;
    }
}
```

### Complexity Analysis
Time: `O(n^2)`
Space: `O(n)`

## Method 1. Sliding Window + HashSet
### Main Idea
Two pointers, if no repeat, increment `fast`, else, keep incrementing `slow` until we remove the duplicate, so in the worst case we need to traverse each element exactly twice.
### Code
```java
class Solution {
    public int lengthOfLongestSubstring(String s) {
        boolean[] set = new boolean[128];
        int left = 0, right = 0, maxLen = 0, n = s.length();
        while (right < n) {
            while (right < n && !set[s.charAt(right)]) {
                set[s.charAt(right)] = true;
                right++;
            }

            maxLen = Math.max(maxLen, right - left);
            set[s.charAt(left)] = false;
            left++;
        }

        return maxLen;
    }
}
```
### Complexity Analysis
Time: `O(2*n) = O(n)`
Space: `O(n)`

## Method 2. One Scan with Map (Optimization)
### Main Idea
In Method 1, we need to move the left boundary of the sliding window step by step, which causes extra runtime. Actually, we can use a map to record the index of last occurrences of each character, and when seeing repeated character, we can get its previous index, and `left = index + 1`.

```java
class Solution {
    public int lengthOfLongestSubstring(String s) {
        Map<Character, Integer> map = new HashMap<>();
        int slow = 0, fast = 0, n = s.length(), maxLen = 0;
        while (fast < n) {
            if (map.containsKey(s.charAt(fast)) && map.get(s.charAt(fast)) >= slow) {
                slow = map.get(s.charAt(fast)) + 1;
            }

            maxLen = Math.max(maxLen, fast - slow + 1);
            map.put(s.charAt(fast), fast++);
        }

        return maxLen;
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(n)`

### Main Idea
Two pointers, fast goes two times faster than slow pointer, when fast reaches the end of linked list, slow pointer will be the middle node.
### Code
```java
class Solution {
    public ListNode middleNode(ListNode head) {
        if (head == null) return null;
        ListNode fast = head, slow = head;
        while (fast != null && fast.next != null) {
            fast = fast.next.next;
            slow = slow.next;
        }
        return slow;
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(1)`

## Method. Two pointers
### Main Idea
Define two pointers `fast` and `slow`, and we will have 3 regoins:
* `[0, slow - 1]`: the output array, no duplicates in this region.
* `[slow: fast -1]`: Duplicate elements that we want to discard.
* `[fast, n - 1]`: unexplored region.

Each iteration, if `nums[fast] != nums[slow - 1]`, that means we `nums[fast]` is not a duplicate element, so we move it to `slow`, then increment slow so `arr[0:slow-1]` is still a region with no duplicates.

### Code

```java
class Solution {
    public int removeDuplicates(int[] nums) {
        int fast = 0, slow = 0, n = nums.length;
        while (fast < n) {
            if (slow == 0 || nums[fast] != nums[slow - 1]) {
                nums[slow++] = nums[fast++];
            } else {
                ++fast;
            }
        }
        return slow;
    }
}
```
