Time: `O(n)` 

Space: `O(1)`

### Main Idea
Find the first element that is greater than `target`, and that's the insert position.

### Code

```java
class Solution {
    public int searchInsert(int[] nums, int target) {
        int n = nums.length, left = 0, right = n - 1;
        
        while (left < right) {
            int mid = left + (right - left) / 2;
            if (nums[mid]  ==  target) {
                return mid;
            } else if (nums[mid] > target) {
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }
        
        return nums[left] >= target ? left : left + 1;
        
    }
}
```

