### Main Idea
We are looking for the rolling maximum values of intervals, so the intuition is to use a heap to keep track of the dynamic max/min values.

We can use a max heap `pq` to store the `(index,value)` pair and sort them by value with descending order.

Push the first K elements to the priority queue `{val, index}`. Then at the beginning of each iteration, we can check if the heap top is within the valid range, if not, then we can remove it until we find a valid one, this will be the local max.
### Code
* Java

```java
class Solution {
    public int[] maxSlidingWindow(int[] nums, int k) {
        int n = nums.length;
        // {index, val}
        PriorityQueue<int[]> pq = new PriorityQueue<>((p1, p2) -> p2[1] - p1[1]);
        int[] res = new int[n - k + 1];
        for (int i = 0; i < n; ++i) {
            pq.offer(new int[] {i, nums[i]});
            if (i >= k - 1) {
                while (pq.peek()[0] < i - k + 1) {
                    pq.poll();
                }

                res[i - k + 1] = pq.peek()[1];
            }
        }
        return res;
    }
}
```
### Complexity Analysis
Time: `O(nlogn)`

Space: `O(n)`

### Main Idea
This problem can be moldeled with a directed graph, say each person is a vertex and `trust` are edges.

If `a` trust `b`, then a has an out-degree and `b` has an in-degree, a judge should have a net degree of `n - 1`. So we just need to go though all the edges, calculate the net degree of each vertex, and find the one with net degree of `n - 1`. If not exist, return `-1`.

### Code
* Java

```java
class Solution {
    public int findJudge(int n, int[][] trust) {
        int[] deg = new int[n];
        for (int[] edge : trust) {
            deg[edge[1] - 1]++; 
            deg[edge[0] - 1]--;
        }

        for (int i = 0; i < n; ++i) {
            if (deg[i] == n - 1) return i + 1;
        }

        return -1;
    }
}
```
