 */
class Solution {
    public ListNode rotateRight(ListNode head, int k) {
        if (head == null || k == 0) {
            return head;
        }
        ListNode p = new ListNode();
        p = head; 
        int tot = 1;
        //
        while (p.next != null) {
            p = p.next;
            tot++;
        }
        // k
        k %= tot;
        ListNode w = new ListNode();
        w = head; 
        //  
        for (int i = 0; i < tot - k - 1; i++) {
            w = w.next;
        }
        p.next = head;
        head = w.next;
        w.next = null;
        return head;
    }
}
