        if (!head) return NULL;
        if (!head->next) {
            return new TreeNode(head->val);
        }
        ListNode* pre = NULL, *p = head, *q = head;
        while (q && q->next) {
            q = q->next->next;
            pre = p;
            p = p->next;
        }
        pre->next = NULL;
        TreeNode* root = new TreeNode(p->val);
        root->left = dfs(head);
        root->right = dfs(p->next);
        return root;
    }
