            if nxt_min_num >= max_num:
                cur, min_num, max_num = nxt, nxt_min_num, nxt_max_num
                continue
            else:
                return False
        return True

    def tryMerge(self, arr):
        res = []
        i = 0
        for i in range(len(arr)):
            cur, cur_min_num, cur_max_num = arr[i]
            if not res:
                res.append(arr[i])
            else:
                while res:
                    prev, prev_min_num, prev_max_num = res.pop()
                    if not (cur_min_num >= prev_max_num):
                        cur, cur_min_num, cur_max_num = prev+cur, min(cur_min_num, prev_min_num), max(cur_max_num, prev_max_num)
                    else:
                        res.append([prev, prev_min_num, prev_max_num])
                        break
                res.append([cur, cur_min_num, cur_max_num])
        return res
