        int mid = l + r >> 1, t = mid - l;
        ListNode cur = head;
        while (t-- > 0) cur = cur.next;
        TreeNode ans = new TreeNode(cur.val);
        ans.left = build(head, l, mid - 1);
        ans.right = build(cur.next, mid + 1, r);
