            int min_index = i;
            if (2 * i + 1 < length && nums[2 * i + 1] > nums[min_index]) min_index = 2 * i + 1;
            if (2 * i + 2 < length && nums[2 * i + 2] > nums[min_index]) min_index = 2 * i + 2;
