        Arrays.sort(nums);
        int absMin = 0;
        int absMax = nums[nums.length-1] - nums[0];

        while (absMin <= absMax) {
            int absMid = (absMin + absMax) / 2;
            if (count_not_greater(nums, absMid) <= k) {
                absMin = absMid + 1;
            } else {
                absMax = absMid - 1;
            }
