class Solution:
    def findJudge(self, n: int, trust: List[List[int]]) -> int:
        trusted = [0] * (n+1)
        for (a,b) in trust:
            trusted[a] -= 1
            trusted[b] += 1
        for i in range(1, len(trusted)):
            if trusted[i] == n-1:
                return i
        return -1

