class Solution:
    def possibleBipartition(self, n: int, dislikes: List[List[int]]) -> bool:
        g = defaultdict(list)

        for x,y in dislikes:
            g[x].append(y)
            g[y].append(x)

        color = {}

        def dfs(i,c):
            if i in color: return color[i] == c
            color[i] = c
            for enemy in g[i]:
                if not dfs(enemy, 1-c):  # Check all neighbors, return False if any conflict
                    return False
            return True

        for i in range(1, n+1):
            if i not in color:
                 if not dfs(i, 1):  # Start a DFS for unvisited nodes
                    return False

        return True

class Solution:
    def mySqrt(self, x: int) -> int:
        if x == 0: return 0
        left, right = 1, x
        while left <= right:
            mid = (left + right)//2
            if mid * mid == x: 
                return mid
            elif mid * mid < x: 
                left = mid + 1
            else: 
                right = mid - 1
        return right

